import React from "react";
import "./NavBar.css";
import { Link } from "react-router-dom";
// import Data from "../Data/data";
const NavBar = () => {
  //   Data.map((element, index) => {
  //     return(    <Link>{element.name}</Link>
  // )
  //   });
  return (
    <div id="main-menu">
      <menu className="main-menu">
        <label id="hamburger-menu">
          <input type="checkbox" />
          <span className="menu">
            {" "}
            <span className="hamburger"></span>{" "}
          </span>
          <ul className="ul">
            <br />
            <li>
              {" "}
              <Link className="li" to="/">
                Home
              </Link>{" "}
            </li>
            <br/>
            <li>
              {" "}
              <Link className="li" to="/">
                Order
              </Link>{" "}
            </li>
            <li>
              {" "}
              <Link className="li" to="/">
                Leaderboards
              </Link>{" "}
            </li>
            <li>
              {" "}
              <Link className="li" to="/">
                Marketplace
              </Link>{" "}
            </li>
            <li>
              {" "}
              <Link className="li" to="/faqs">
                FAQs
              </Link>{" "}
            </li>{" "}
            <br />
          </ul>
        </label>
      </menu>
      {/* <div className="div"> */}
        <Link to="/home">
          <img
            className="logo"
            src="./images/Twenteefore - Logo 2.png"
            alt="logo"
          />
        </Link>
        <nav className="navbar">
          {" "}
          <Link className="homeLink" to="/">
            Home
          </Link>
          <Link className="orderLink" to="/">
            Order
          </Link>
          <Link className="leaderboardsLink" to="/">
            Leaderboards
          </Link>{" "}
          <Link className="marketplaceLink" to="/">
            Marketplace
          </Link>{" "}
          <Link className="faqsLink" to="/faqs">
            FAQs
          </Link>
        </nav>
      {/* </div> */}
      <Link className="loginLink" to="/login">
        <button id="loginLink">Log In</button>
      </Link>
    </div>
  );
};
export default NavBar;
